import React from "react";
import computer from '../images/pic1.jpeg';
function Home(){
    return(
        <>

        <div className="my-3 mx-5">
        <strong>Hello! my name is Prashant Sah.</strong>
        </div>
        <div className="my-3 mx-5">
        Currently i'm pursuing my Associate degree in Computer Programming and Software development.
        </div>
        <div className="position-relative">
        <img src={computer} className="position-absolute top-50 end-0 translate-middle-y" alt="could not load"/>
        </div>
        </>
    );
}
export default Home;
